function entry_sim(df, delta, prof_excl_comp)
    N = nrow(df);
    n = ones(ns);
    EntryCond = zeros(Int64, N, ns);

    for i = 1:N
        net_prof = prof_excl_comp[i, :] .- delta * log.(n);
        EntryCond[i, net_prof .> 0.0] .= 1;
        n[net_prof .> 0.0] .+= 1;
    end

    return vec(mean(EntryCond, dims = 2))
end

